import React from 'react';
import {
  Box,
  Typography,
  TextField,
  Grid,
  Button,
  Snackbar,
  Alert,
  InputAdornment,
  useTheme,
  useMediaQuery,
} from '@mui/material';
import AccountCircleIcon from '@mui/icons-material/AccountCircle';
import EmailIcon from '@mui/icons-material/Email';
import SubjectIcon from '@mui/icons-material/Subject';
import SendIcon from '@mui/icons-material/Send';
import CancelIcon from '@mui/icons-material/Cancel';
import SupportAgentIcon from '@mui/icons-material/SupportAgent';
import { useNavigate } from 'react-router-dom';

export default function ContactoForm() {
  const navigate = useNavigate();
  const theme = useTheme();
  const isMobile = useMediaQuery(theme.breakpoints.down('sm'));

  const [formData, setFormData] = React.useState({
    nombre: '',
    correo: '',
    asunto: '',
    mensaje: '',
  });

  const [errores, setErrores] = React.useState({});
  const [enviado, setEnviado] = React.useState(false);

  const validar = () => {
    const newErrors = {};
    const correoRegex = /^[^\s@]+@[^\s@]+\.[^\s@]+$/;

    if (!formData.nombre.trim()) newErrors.nombre = 'Este campo es obligatorio';
    if (!formData.correo || !correoRegex.test(formData.correo))
      newErrors.correo = 'Ingrese un correo válido';
    if (!formData.asunto.trim()) newErrors.asunto = 'Debe ingresar un asunto';
    if (!formData.mensaje.trim()) newErrors.mensaje = 'Debe escribir un mensaje';

    setErrores(newErrors);
    return Object.keys(newErrors).length === 0;
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    if (validar()) {
      // Simular envío
      console.log('Mensaje enviado:', formData);
      setEnviado(true);
      setFormData({ nombre: '', correo: '', asunto: '', mensaje: '' });
      setTimeout(() => navigate(-1), 3000);
    }
  };

  const handleCancel = () => {
    navigate(-1);
  };

  return (
    <Box
      sx={{
        minHeight: '100vh',
        bgcolor: '#f0f7f4',
        display: 'flex',
        flexDirection: 'column',
        justifyContent: 'center',
        px: isMobile ? 2 : 6,
        py: 8,
        fontFamily: "'Segoe UI', Tahoma, Geneva, Verdana, sans-serif",
      }}
    >
      {/* Encabezado con ícono */}
      <Box
        sx={{
          mb: 5,
          display: 'flex',
          alignItems: 'center',
          justifyContent: 'center',
          gap: 1.5,
          color: '#2e7d32',
          fontWeight: '700',
          fontSize: isMobile ? '1.7rem' : '2.2rem',
          userSelect: 'none',
        }}
      >
        <SupportAgentIcon fontSize="large" />
        <Typography component="h1">Solicita tu asesoría personalizada</Typography>
      </Box>

      {/* Formulario */}
      <Box
        component="form"
        onSubmit={handleSubmit}
        noValidate
        sx={{
          maxWidth: 720,
          bgcolor: 'white',
          mx: 'auto',
          p: isMobile ? 3 : 6,
          borderRadius: 4,
          boxShadow: '0 10px 30px rgba(0,0,0,0.1)',
          transition: 'box-shadow 0.3s ease',
          '&:hover': {
            boxShadow: '0 14px 45px rgba(0,0,0,0.15)',
          },
        }}
      >
        <Typography
          variant="subtitle1"
          sx={{
            mb: 4,
            color: '#388e3c',
            fontWeight: 600,
            textAlign: 'center',
            fontSize: isMobile ? '1rem' : '1.15rem',
            lineHeight: 1.5,
          }}
        >
          ¿Necesitas ayuda con tus productos, accesibilidad o compras institucionales? <br />
          Nuestro equipo te responderá en menos de <strong>48 horas</strong>.
        </Typography>

        <Grid container spacing={4}>
          {/* Nombre */}
          <Grid item xs={12} sm={6}>
            <TextField
              name="nombre"
              label="Nombre completo"
              variant="outlined"
              fullWidth
              value={formData.nombre}
              onChange={(e) =>
                setFormData((prev) => ({ ...prev, nombre: e.target.value }))
              }
              error={!!errores.nombre}
              helperText={errores.nombre}
              InputProps={{
                startAdornment: (
                  <InputAdornment position="start">
                    <AccountCircleIcon color={errores.nombre ? 'error' : 'action'} />
                  </InputAdornment>
                ),
              }}
              InputLabelProps={{
                shrink: !!formData.nombre,
                sx: {
                  color: errores.nombre ? '#d32f2f' : '#388e3c',
                  fontWeight: 600,
                  transition: 'all 0.3s ease',
                },
              }}
            />
          </Grid>

          {/* Correo */}
          <Grid item xs={12} sm={6}>
            <TextField
              name="correo"
              label="Correo electrónico"
              variant="outlined"
              fullWidth
              type="email"
              value={formData.correo}
              onChange={(e) =>
                setFormData((prev) => ({ ...prev, correo: e.target.value }))
              }
              error={!!errores.correo}
              helperText={errores.correo}
              InputProps={{
                startAdornment: (
                  <InputAdornment position="start">
                    <EmailIcon color={errores.correo ? 'error' : 'action'} />
                  </InputAdornment>
                ),
              }}
              InputLabelProps={{
                shrink: !!formData.correo,
                sx: {
                  color: errores.correo ? '#d32f2f' : '#388e3c',
                  fontWeight: 600,
                  transition: 'all 0.3s ease',
                },
              }}
            />
          </Grid>

          {/* Asunto */}
          <Grid item xs={12}>
            <TextField
              name="asunto"
              label="Asunto"
              variant="outlined"
              fullWidth
              value={formData.asunto}
              onChange={(e) =>
                setFormData((prev) => ({ ...prev, asunto: e.target.value }))
              }
              error={!!errores.asunto}
              helperText={errores.asunto}
              InputProps={{
                startAdornment: (
                  <InputAdornment position="start">
                    <SubjectIcon color={errores.asunto ? 'error' : 'action'} />
                  </InputAdornment>
                ),
              }}
              InputLabelProps={{
                shrink: !!formData.asunto,
                sx: {
                  color: errores.asunto ? '#d32f2f' : '#388e3c',
                  fontWeight: 600,
                  transition: 'all 0.3s ease',
                },
              }}
            />
          </Grid>

          {/* Mensaje */}
          <Grid item xs={12}>
            <TextField
              name="mensaje"
              label="Mensaje detallado"
              variant="outlined"
              fullWidth
              multiline
              rows={6}
              value={formData.mensaje}
              onChange={(e) =>
                setFormData((prev) => ({ ...prev, mensaje: e.target.value }))
              }
              error={!!errores.mensaje}
              helperText={errores.mensaje}
              InputLabelProps={{
                shrink: !!formData.mensaje,
                sx: {
                  color: errores.mensaje ? '#d32f2f' : '#388e3c',
                  fontWeight: 600,
                  transition: 'all 0.3s ease',
                },
              }}
            />
          </Grid>
        </Grid>

        {/* Botones */}
        <Box
          sx={{
            mt: 5,
            display: 'flex',
            gap: isMobile ? 2 : 4,
            flexDirection: isMobile ? 'column' : 'row',
            justifyContent: 'center',
          }}
        >
          <Button
            type="submit"
            variant="contained"
            startIcon={<SendIcon />}
            fullWidth={isMobile}
            sx={{
              bgcolor: '#2e7d32',
              fontWeight: '700',
              fontSize: '1.1rem',
              py: 1.8,
              borderRadius: 3,
              boxShadow: '0 5px 15px rgba(46,125,50,0.4)',
              transition: 'background-color 0.3s ease, box-shadow 0.3s ease',
              '&:hover': {
                bgcolor: '#1b3d17',
                boxShadow: '0 8px 25px rgba(27,61,23,0.6)',
              },
            }}
          >
            Solicitar asesoría
          </Button>

          <Button
            variant="outlined"
            color="error"
            startIcon={<CancelIcon />}
            onClick={handleCancel}
            fullWidth={isMobile}
            sx={{
              fontWeight: '700',
              fontSize: '1.1rem',
              py: 1.8,
              borderRadius: 3,
            }}
          >
            Cancelar
          </Button>
        </Box>
      </Box>

      {/* Snackbar de confirmación */}
      <Snackbar
        open={enviado}
        autoHideDuration={4000}
        onClose={() => setEnviado(false)}
        anchorOrigin={{ vertical: 'top', horizontal: 'center' }}
      >
        <Alert
          severity="success"
          variant="filled"
          onClose={() => setEnviado(false)}
          sx={{ bgcolor: '#2e7d32', color: 'white', fontWeight: '700' }}
        >
          ¡Tu solicitud ha sido enviada correctamente!
        </Alert>
      </Snackbar>
    </Box>
  );
}
